(33, 'Cleaning', 'b600dc0e55ac8a6a950983614d67af29.png', 0, '<p xss=\"removed\">\r\n <span xss=\"removed\">Keeping your home spotless is easier than ever with our affordable cleaning plans. Choose the frequency that fits your schedule, and you can relax knowing your home will be cleaned on schedule with the flexibility to make any changes needed.</span></p>', 'cc', 'cc', 'cc', 'active', '2017-02-03 13:25:57', '2017-05-16 18:12:55', '2', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"},{\"professionals\":\"small items\",\"unit\":\"1\",\"hours\":\"2\",\"price\":\"10\"},{\"professionals\":\"large items\",\"unit\":\"1\",\"hours\":\"3\",\"price\":\"20\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(34, 'Home Cleaning', 'd5cc922cfa0d2a1ef698896352900c57.jpg', 33, '<h5>\r\n <strong>You&#39;re on your way to a clean home</strong></h5>\r\n<p>\r\n Relax knowing your home will be cleaned on schedule with one of 88HOMEPROS flexible cleaning plans.</p>\r\n<ul>\r\n <li>\r\n  Backed by The 88 Home Pros Happiness Guarantee</li>\r\n <li>\r\n  Easily manage your cleanings with the Home Services</li>\r\n <li>\r\n  Experienced & background-checked professionals</li>\r\n <li>\r\n  Specify your favorite professional for your regular cleanings</li>\r\n <li>\r\n  Cleaning supplies included</li>\r\n <li>\r\n  Always-on customer service</li>\r\n</ul>', 'Home Cleaning', 'Home Cleaning', 'Home Cleaning', 'active', '2017-02-03 14:29:41', '2018-03-28 16:10:30', '1', '[{\"professionals\":\"bedrooms\",\"unit\":\"1\",\"hours\":\"1\",\"weekly_price\":\"5\",\"biweekly_price\":\"6\",\"monthly_price\":\"7\"},{\"professionals\":\"bathrooms\",\"unit\":\"1\",\"hours\":\"1\",\"weekly_price\":\"7\",\"biweekly_price\":\"8\",\"monthly_price\":\"9\"}]', '-', '', '[{\"hourly\":\"1\",\"hourly_price\":\"3\"},{\"hourly\":\"2\",\"hourly_price\":\"5\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
