(53, 'Garage Door Repair', 'a2a15d2a77edd1049163b5baa75722bd.jpg', 48, '<p>\n <strong>Repair a Garage Door</strong></p>\n<p>\n <strong>Garage Door Repair</u></strong><br>\n <br>\n As many home robberies occur either in the garage or through the garage,<br>\n a broken garage door can be a big welcome sign to crime.<br>\n This is why it is so important to...Find out more about Garage Door Repair.<br>\n <br>\n <br>\n <strong>Garage Doors</strong><br>\n <br>\n Is your garage door sagging and cracking, almost impossible to lift,<br>\n or just generally falling apart? Perhaps it&#39;s time to replace it with a<br>\n new one that&#39;s easy to operate...Read more about Garage Doors.</p>\n<p>\n  </p>', 'hgh', 'hgh', 'hgfh', 'active', '2017-03-07 18:34:39', '2017-04-03 12:58:32', '4', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', 'Is this an emergency? ', '[{\"stuff\":\"Yes\"},{\"stuff\":\"No\"}]', '', '', '', '', '', '', '', ''),
(54, 'Furniture Assembly', 'd3d7f4da947b10cb2a2183b8ce4dc749.jpg', 48, '<p>\n<strong>Furniture Assembly</strong></p>\n<p>\n Have your furniture assembled quickly & correctly<br>\n <br>\n Let an expert fit your flat packs to make them last!</p>\n<ul>\n <li>\n  Assembling flatpacks of all types and brands</li>\n <li>\n  All tools and equipment provided</li>\n <li>\n  An efficient, convenient, and neat service</li>\n</ul>\n<p>\n <strong>How the flat pack assembly service works</strong><br>\n <br>\n <strong>Step 1</strong>: A fully equipped furniture assembly team will come to your address.<br>\n <br>\n <strong>Step 2</strong>: Have your new flat packs ready and tell the specialist where you want them placed.<br>\n <br>\n <strong>Step 3</strong>: The team will assemble the furniture and situate it where you want it.<br>\n <br>\n <strong>Step 4</strong>: You can start using your newly built furniture right away!</p>\n<p>\n  </p>\n<p>\n <strong>Efficient, reliable London furniture assemblers ready to help you</strong><br>\n <br>\n Neat, fully equipped technicians<br>\n You don’t have any tools at home? No worries, the specialists will bring everything necessary to assemble your new flat packs. The team will be careful not to cause any mess while working. Please note that the professionals have public liability insurance.<br>\n <br>\n Quick booking & quick to arrive<br>\n Give our convenient online booking form a try! It is an easy way to make an appointment for any of our services</p>\n<p>\n <br>\n Transparent pricing – pay only for what you get<br>\n We have a minimum call out charge for the initial 2 hours. Afterwards, you are only charged for each consecutive period of 30 minutes, regardless of how much time you actually booked.<br>\n <br>\n Guaranteed Fantastic quality<br>\n The furniture assemblers are fully dedicated to bring you the best possible results. Fantastic Services monitors their performance and collects feedback from clients on a regular basis to ensure that our clients will be 100% content with what they get.<br>\n <br>\n  </p>\n<p>\n  </p>', 'gfgd', 'gfdgdf', 'gfdgfd', 'active', '2017-03-07 18:35:54', '2017-03-22 18:19:04', '6', '', 'Do you need any of the items attached to a wall?', '[{\"stuff\":\"Yes\"},{\"stuff\":\"No\"}]', '', '', '', '', '', '', '', ''),
(35, 'Office cleaning', '8ccf1a055e3a0a1d1a90b2d1770f8adc.jpg', 33, '<p>\n <strong>You&#39;re on your way to a clean Office</strong></p>\n<p>\n Home Services fully vetted maids provide top-quality service and will clean your office from top-to-bottom. All of our background checked professionals have years of experience and come equipped with premium eco-friendly supplies and state of the art cyclonic vacuums.</p>\n<ul>\n <li>\n  Backed by The Handy Happiness Guarantee</li>\n <li>\n  Easily manage your cleaning.</li>\n <li>\n  Experienced & background-checked professionals</li>\n <li>\n  Specify your favorite professional for your regular cleanings</li>\n <li>\n  Cleaning supplies included</li>\n</ul>', 'aa', 'aa', 'aa', 'active', '2017-02-03 14:40:31', '2017-04-06 15:39:23', '5', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', '-', '', '[{\"hourly\":\"2\",\"hourly_price\":\"5\"},{\"hourly\":\"3\",\"hourly_price\":\"6\"},{\"hourly\":\"4\",\"hourly_price\":\"7\"},{\"hourly\":\"5\",\"hourly_price\":\"8\"},{\"hourly\":\"6\",\"hourly_price\":\"9\"},{\"hourly\":\"7\",\"hourly_price\":\"10\"},{\"hourly\":\"8\",\"hourly_price\":\"11\"},{\"hourly\":\"9\",\"hourly_price\":\"12\"},{\"hourly\":\"10\",\"hourly_price\":\"13\"}]', 'How many hours would you like to book?', '[{\"stuff_1\":\"\"},{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"},{\"stuff_2\":\"\"}]', '', '', ''),
(50, 'Painting', '3cff3ba4861dd2a5d4919247cceec1ba.jpg', 48, '<p>\r\n <strong>Interior Painting</strong></p>\r\n<p>\r\n <br>\r\n Pay by the hour to have your home professionally painted. Any interior room of your house or apartment can be painted - kitchen, living room, bedroom, bathroom and sitting room. We even paint trim, doors and ceilings.<br>\r\n <br>\r\n The painter will provide all necessary rollers, brushes, tape and floor coverings. Customers are required to provide primer and paint.</p>\r\n<ul>\r\n <li>\r\n  Background- and identity-checked professionals</li>\r\n <li>\r\n  Friendly 24/7 customer service</li>\r\n <li>\r\n  Affordable pricing</li>\r\n <li>\r\n  100% money-back guarantee</li>\r\n</ul>', 'fsdf', 'sdfs', 'fsdf', 'active', '2017-03-07 18:02:15', '2017-06-23 14:02:29', '2', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"},{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', '-', '', '[{\"hourly\":\"1\",\"hourly_price\":\"10\"},{\"hourly\":\"2\",\"hourly_price\":\"20\"},{\"hourly\":\"3\",\"hourly_price\":\"30\"},{\"hourly\":\"4\",\"hourly_price\":\"40\"}]', 'Number of professionals', '[{\"stuff_1\":\"1\"},{\"stuff_1\":\"2\"},{\"stuff_1\":\"3\"},{\"stuff_1\":\"4\"}]', 'Will a ladder be required', '[{\"stuff_2\":\"No\"},{\"stuff_2\":\"Yes - 6 Ft (1.8 m)\"},{\"stuff_2\":\"Yes - 10 Ft (3.0 m)\"}]', '', '', ''),
