(52, 'Lock Smith', 'cb404a4001ba94eb2c199e086c52ec6f.jpg', 48, '<p>\n<strong>Locksmith Service</strong></p>\n<p>\n <strong>Basic Door Locks</strong><br>\n <br>\n The level of security a lockset offers depends on its construction.<br>\n Any type with only a key in the knob or handle is only marginally secure.<br>\n <br>\n <strong>Checklist: Home Safety</strong><br>\n <br>\n Here are some things you can do to make your home safer:<br>\n Do not leave a house key under a mat, in the mailbox or in any other obvious hiding area near.</p>', 'hgfh', 'gf', 'hfgh', 'active', '2017-03-07 18:33:13', '2017-03-22 17:51:06', '3', '', 'Where do you need service? ', '[{\"stuff\":\"Home \\/ Residence\"},{\"stuff\":\"Business \\/ Commercial\"},{\"stuff\":\"Car \\/ Auto\"}]', '', '', '', '', '', '', '', ''),
