(51, 'Helping Hand', 'eff69840953637389c346d903b71045d.jpg', 48, '<p>\n <strong>Helping Hand</strong></p>\n<p>\n <br>\n Book a background- and identity checked Helping Helper to lend a hand!<br>\n Not for jobs requiring tools.<br>\n <br>\n Whether it&#39;s rearranging furniture, decorating for a party, or running an errand, the friendly and experienced helpers available through the Handy platform are at your service. They are happy to help with all your simple household tasks that do not require tools.</p>\n<ul>\n <li>\n  Background- and identity-checked professionals</li>\n <li>\n  Friendly 24/7 customer service</li>\n <li>\n  Affordable pricing</li>\n <li>\n  100% money-back guarantee</li>\n</ul>', 'gfgfg', 'hfhf', 'gfhgfh', 'active', '2017-03-07 18:05:20', '2017-03-21 17:49:22', '3', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', 'How many helpers are needed?', '[{\"stuff\":\"1\"},{\"stuff\":\"2\"},{\"stuff\":\"3\"}]', '', '', '', '', '', '', '', ''),
(101, 'Light Fixtures', '151e545aec4706d190e027c7294de44d.jpg', 86, '<p>\n <strong>Qualified electricians</strong></p>\n<p>\n The qualified electrician is able to handle all domestic electrical issues that you might be experiencing. From simple installations to meticulous rewiring and repairs, you can always count on him to get the job done. Each expert is fully insured.</p>\n<p>\n <strong>All tools & equipment provided</strong></p>\n<p>\n The electrician brings everything necessary to solve your problem, even a variety of ladders for those hard-to-get-to areas! Just make sure to let us know what you need done at least one day in advance.</p>\n<p>\n <strong>Friendly and professional</strong></p>\n<p>\n This service comes with minimal to no disturbance at all. The electrician is there to get the job done for you. He will be more than glad to answer any questions you might have while he is working on site.</p>\n<p>\n <strong>Online booking is quick & easy</strong></p>\n<p>\n Give our online booking form a try! It’s simple and it takes just a few moments.</p>', 'Light Fixtures', 'Light Fixtures', 'Light Fixtures', 'active', '2017-03-21 16:58:47', '2017-06-28 12:58:59', '1', '[{\"professionals\":\"change bulbs\",\"unit\":\"1\",\"hours\":\"2\",\"fixed_price\":\"10\"},{\"professionals\":\"install new lights\",\"unit\":\"1\",\"hours\":\"3\",\"fixed_price\":\"20\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', 'Will a ladder be required?', '[{\"stuff_1\":\"No\"},{\"stuff_1\":\"Yes - 6ft\"},{\"stuff_1\":\"Yes - 10ft\"}]', 'Do you need us to provide the fixtures?', '[{\"stuff_2\":\"\"}]', '', '', ''),
