(55, 'Appliance Fixing Repair', 'fe3d6ad57c8f25e415f9ab3dc4488389.jpg', 48, '<p>\n<strong>Appliance Fixing  & Repair</strong></p>\n<p>\n <strong>Create a Turn-of-the-Century Look With Metal Ceilings</strong><br>\n <br>\n The world of construction is becoming more and more homogenous as the years go by.<br>\n Instead of hiring a contractor to build a one-of-a-kind house,<br>\n it is very common ...Read more about Metal Ceiling.</p>\n<p>\n <strong>Selecting Major Appliances</strong><br>\n <br>\n When updating a kitchen or laundry room,<br>\n you&#39;ll need to make important decisions about household appliances.<br>\n In a typical kitchen, the appliances represent...Read more about Major Appliances.</p>', 'gfgfd', 'gfdg', 'gdg', 'active', '2017-03-07 18:36:51', '2017-04-26 17:38:26', '7', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(56, 'Light Bulb Installation', '43736db8f755a9964fe5e7d462d93e0a.jpg', 48, '<p>\n<strong>Light Fixtures</strong></p>\n<p>\n Our professional electricians are experts installing all types of light fixtures.<br>\n From bathroom fixtures to chandeliers and even recessed lighting,<br>\n we have you covered. Every electrician is fully vetted and will arrive prepared with the proper tools and supplies to get your job done right the first time.</p>\n<ul>\n <li>\n  Background- and identity-checked professionals</li>\n <li>\n  100% money-back guarantee</li>\n <li>\n  Friendly 24/7 customer service</li>\n <li>\n  Affordable pricing</li>\n</ul>\n<p>\n  </p>', 'fgg', 'gdg', 'gdg', 'active', '2017-03-07 18:37:48', '2017-03-22 17:59:14', '8', '[{\"professionals\":\"install new lights\",\"unit\":\"1\",\"hours\":\"20\",\"fixed_price\":\"120\"},{\"professionals\":\"change bulbs\",\"unit\":\"1\",\"hours\":\"20\",\"fixed_price\":\"120\"}]', 'Will a ladder be required?', '[{\"stuff\":\"\"},{\"stuff\":\"No\"},{\"stuff\":\"Yes\"}]', '', '', '', '', '', '', '', ''),
(57, 'Movers', '8c848be8c495c2b910d45d58bc472bb0.jpg', 48, '<p>\n<strong>Movers</strong></p>\n<p>\n <strong>Move your belongings quickly and without a scratch</strong><br>\n <br>\n Have your boxes, heavy furniture, or pieces of art reach your new home safely with reliable home removals services in London</p>\n<ul>\n <li>\n  Same day appointments available at your request</li>\n <li>\n  Insured and experienced home removals team</li>\n <li>\n  Full service: loading, transportation, and unloading</li>\n</ul>\n<p>\n <strong>Move your items in three simple steps</strong><br>\n <br>\n <strong>Getting your possessions from point A to point B is simple. Here’s how it’s done:</strong><br>\n <br>\n <strong>Step 1</strong>: Get in touch<br>\n Book a home removals service online via our booking form or GoFantastic app and either describe or send pictures of the items you want to move.<br>\n <br>\n <strong>Step 2</strong>: Meet the team<br>\n A team of 2 or 3 domestic removals specialists will arrive in a suitably-sized van to prepare your items for collection. The experts can also dismantle and reassemble furniture as part of the service.<br>\n <br>\n <strong>Step 3</strong>: Enjoy fantastic results<br>\n The team will load your items into a suitably-sized van to safely deliver them at their new location. If you have booked a packing service as well, the specialists will take care of that first.</p>', 'fgfdg', 'gfgdfs', 'ggsd', 'active', '2017-03-07 18:38:49', '2017-03-21 18:35:42', '9', '', 'Please tell us about the property you are moving from', '[{\"stuff\":\"studio\"},{\"stuff\":\"\"}]', '', '', '', '', '', '', '', ''),
