(61, 'Air Conditioning and Heating', '59f260b02cb6b721b03f44ef4a7edd89.jpg', 58, '<p>\n <strong>Air Conditioning & Heating</strong></p>\n<p>\n Save yourself from the summer heat and let our professional handymen install your window AC.<br>\n Every handyman is background- identity-checked and will arrive prepared with the proper tools and supplies to get your AC installed securely in no time.</p>\n<ul>\n <li>\n      Background- and identity-checked professionals</li>\n <li>\n      100% money-back guarantee</li>\n <li>\n      Friendly 24/7 customer service</li>\n <li>\n      Affordable pricing</li>\n</ul>', 'gfdg', 'gdfgdf', 'dfgdf', 'active', '2017-03-07 18:45:42', '2017-05-15 12:34:53', '4', '[{\"professionals\":\"window units\",\"unit\":\"1\",\"hours\":\"2\",\"fixed_price\":\"20\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"},{\"hourly\":\"\",\"hourly_price\":\"\"}]', 'What do you need done?', '[{\"stuff_1\":\"Add repair\"},{\"stuff_1\":\"Inspection\"},{\"stuff_1\":\"Install\"},{\"stuff_1\":\"Uninstall\"}]', '', '[{\"stuff_2\":\"\"},{\"stuff_2\":\"\"},{\"stuff_2\":\"\"}]', '', '', ''),
(62, 'Pest Control', 'f93b4e47cb06de3a11fa76ac55a14ddb.jpg', 58, '<p>\n <strong>Pest Control</strong></p>\n<p>\n <strong>Landscape Solutions</strong><br>\n <br>\n Landscape designers are experts at landscape design,<br>\n schooled in both the practical aspects of landscaping,<br>\n as well as adding an artistic touch to your outdoor...Read more about Landscape Solutions.</p>\n<p>\n <strong>Checklist: Landscape Maintenance</strong><br>\n <br>\n The first thing to remember with any landscape is that it&#39;s a living, breathing entity. Even the simplest,<br>\n easy-to-care for yard will need watering, feeding, cleaning...Read more about Landscape Maintenance.</p>\n<p>\n  </p>', 'fhgfh', 'hgfh', 'hfh', 'active', '2017-03-07 18:46:38', '2017-05-15 12:47:34', '5', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', '-', '', '[{\"hourly\":\"1\",\"hourly_price\":\"10\"},{\"hourly\":\"2\",\"hourly_price\":\"20\"}]', 'Number of Rooms', '[{\"stuff_1\":\"1\"},{\"stuff_1\":\"2\"},{\"stuff_1\":\"3\"}]', 'What is the approximate square footage of your home?', '[{\"stuff_2\":\"Less then 1,000\"},{\"stuff_2\":\"1,000 - 2,000\"},{\"stuff_2\":\"More then 3000\"}]', '', '', ''),
(63, 'Security Alarm and Camera Installation', 'b235984495e394d4bb1a0743f8f92b65.jpg', 58, '<p>\n <strong>Security Alarm & Camera Installation</strong></p>\n<p>\n <strong>Alarm Companies</strong><br>\n <br>\n While homeowners might disagree on a wide variety of issues,<br>\n it&#39;s the rare person who can honestly say that they don&#39;t care what happens to their family or property ...Read more about Alarm Companies.</p>\n<p>\n <strong>Video Security Cameras: Why Everyone Should Have Them</strong><br>\n <br>\n In modern America, most of us (especially city dwellers) are getting used to the idea of video surveillance cameras watching what we do in stores, at work,<br>\n and even at traffic ...Read more about Security Camera.</p>', 'gfg', 'fgdfsg', 'gdfsg', 'active', '2017-03-07 18:47:37', '2017-04-05 16:12:05', '6', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"},{\"professionals\":\"\",\"unit\":\"1\",\"hours\":\"20\",\"price\":\"20\"}]', 'What kind of service do you need?', '[{\"stuff\":\"Addition to an existing system\"},{\"stuff\":\"New Installation\"},{\"stuff\":\"Other\"}]', '', '', '', '', '', '', '', ''),
