(72, 'Carpet Cleaning', 'aafc3ed492e933a89d4e8b4e7d995b60.jpg', 33, '<p>\r\n <strong>It’s not just carpet cleaning. It’s a healthier home!</strong></p>\r\n<ul>\r\n <li>\r\n  For all types of fabrics</li>\r\n <li>\r\n  Dealing with common household stains</li>\r\n <li>\r\n  Modern effective treatment by certified technicians</li>\r\n <li>\r\n  Carpet/Rug Cleaning</li>\r\n</ul>\r\n<p>\r\n Inspecting of the carpet fibers before cleaning.</p>\r\n<p>\r\n  </p>', 'hfh', 'hfdh', 'hfgh', 'active', '2017-03-07 18:58:08', '2017-03-21 16:19:20', '2', '[{\"professionals\":\"Bedrooms\",\"unit\":\"1\",\"hours\":\"2\",\"fixed_price\":\"20\"},{\"professionals\":\"Living Rooms\",\"unit\":\"1\",\"hours\":\"4\",\"fixed_price\":\"20\"},{\"professionals\":\"Hallway\",\"unit\":\"1\",\"hours\":\"4\",\"fixed_price\":\"50\"}]', '', '[{\"stuff\":\"\"},{\"stuff\":\"\"},{\"stuff\":\"\"}]', '', '', '', '', '', '', '', ''),
(73, 'Window Cleaning', '2cfbcfd1fc3e25d6bf4a9577f61750ec.jpg', 33, '<p>\r\n <strong>Enjoy a streak-free, sparkling-clean view through your windows</strong></p>\r\n<ul>\r\n <li>\r\n  No detergents, just purified water</li>\r\n <li>\r\n  Certified and professional cleaner</li>\r\n <li>\r\n  Same-day appointments available</li>\r\n</ul>\r\n<p>\r\n <strong>No climbing, no hassle – just sparkling windows</strong></p>\r\n<p>\r\n If dust and dirt specks still cling to your windows despite your regular cleaning efforts, it’s time to change the approach. Staying true to the saying “out with the old and in with the new,” our window cleaning services leave ladders and detergents aside in favour of sunshine and filtered water. Safety doesn’t take a back seat, either – the diligent cleaner will use an extension pole to easily tackle resilient stains on hard-to-reach areas without lifting his feet from the ground.</p>', 'uytu', 'uty', 'tyuty', 'active', '2017-03-07 18:58:57', '2018-03-28 16:44:58', '2', '[{\"professionals\":\"floors\",\"unit\":\"1\",\"hours\":\"1\",\"weekly_price\":\"2\",\"biweekly_price\":\"3\",\"monthly_price\":\"4\"},{\"professionals\":\"bedrooms\",\"unit\":\"1\",\"hours\":\"1\",\"weekly_price\":\"5\",\"biweekly_price\":\"6\",\"monthly_price\":\"7\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(74, 'Junk Removal', '6020216477318df940b4a4704ec684df.jpg', 33, '<p>\r\n <strong>Let’s clear some space for the items you love</strong></p>\r\n<p>\r\n Get a house clearance service from an experienced company</p>\r\n<ul>\r\n <li>\r\n  Same-day, weekend & after hours availability</li>\r\n <li>\r\n  Avoid the council waiting list</li>\r\n <li>\r\n  Service includes labour, transportation, and disposal</li>\r\n <li>\r\n  Free surveys 7 days a week</li>\r\n</ul>\r\n<p>\r\n <strong>How it works</strong><br>\r\n <br>\r\n <strong>Step 1</strong>: Contact us<br>\r\n Simply let us know what needs to be cleared and taken away. It might be an entire room, a single heavy object or various household bits and bobs. You can send us a list of items or even pictures of the unwanted items.<br>\r\n <br>\r\n <strong>Step 2</strong>: Get a quote<br>\r\n Based on the description (or pictures) of your waste, we will be able to give you a rough estimate for the work. Please keep in mind that the final quote for your flat clearance service will be given once the waste removal operatives are on the site and are able to evaluate the refuse themselves.<br>\r\n <br>\r\n <strong>Step 3</strong>: Set your appointment<br>\r\n You can choose any time of the day, any day of the week, even weekends and bank holidays. Book online to also get a 10% discount.<br>\r\n <br>\r\n <strong>Step 4</strong>: Meet The Waste Removal Team<br>\r\n You can have all of your waste gathered conveniently and ready for the pick up or you can leave all the labour to the experts. Please make sure that the team will have access to the waste/items for disposal.<br>\r\n <br>\r\n <strong>Step 5</strong>: Say farewell to the rubbish<br>\r\n Once everything is removed and safely loaded into the vehicle, the waste removal specialists will set course for the nearest tip to dispose of it. All you have to do next is to enjoy all that newly acquired free space.</p>', 'hfgh', 'hfh', 'hfgdh', 'active', '2017-03-07 18:59:52', '2017-03-21 16:32:49', '2', '[{\"professionals\":\"Single mattress\",\"unit\":\"1\",\"hours\":\"2\",\"fixed_price\":\"5\"},{\"professionals\":\"Parasol\",\"unit\":\"1\",\"hours\":\"3\",\"fixed_price\":\"10\"},{\"professionals\":\"Laptop\",\"unit\":\"1\",\"hours\":\"3\",\"fixed_price\":\"15\"}]', '', '\n', '', '', '', '', '', '', '', ''),
(75, 'Pressure Washing', '5c8c35bd7a1948f970838fdf2ba80f8f.jpg', 33, '<p>\n <strong>Pressure Washing</strong></p>\n<p>\n your Houston Pressure Washing or Gutter Cleaning task is fast and easy. Just fill out this form and a company representative will contact you promptly. All estimates and bids are completely free of cost with no obligation to you. We respond all requests, mostly in less than 30 minutes. All inquires and estimates are kept confidential. Rest assured that ViperTech Mobile Pressure Wash will never share your personal information with anyone.</p>', 'fjghj', 'jghjf', 'jghf', 'active', '2017-03-07 19:00:39', '2017-03-21 16:40:21', '4', '[{\"professionals\":\"small item\",\"unit\":\"1\",\"hours\":\"3\",\"fixed_price\":\"20\"},{\"professionals\":\"medium item\",\"unit\":\"1\",\"hours\":\"2\",\"fixed_price\":\"20\"},{\"professionals\":\"large item\",\"unit\":\"1\",\"hours\":\"2\",\"fixed_price\":\"40\"}]', '', '[{\"stuff\":\"\"},{\"stuff\":\"\"},{\"stuff\":\"\"}]', '', '', '', '', '', '', '', ''),
(76, 'Sofa Drapery Cleaning', 'a4c5146f8e82a99c6742bf1c9bac77d0.jpg', 33, '<p>\n <strong>Let’s bring back the freshness of your curtains & drapes</strong></p>\n<p>\n Professional curtain and blinds cleaning in London that makes a difference</p>\n<ul>\n <li>\n  Drapery is cleaned on the spot</li>\n <li>\n  Using high-end professional equipment</li>\n <li>\n  Suitable for all kinds of curtains, blinds & drapes</li>\n</ul>\n<p>\n <strong>Types of curtains and drapes we clean</strong><br>\n <br>\n Synthetic/Mixed fibre<br>\n If the items can withstand high temperature and moisture, then they will be submitted to the professional curtain cleaning method known as hot water extraction. The best part is that the technician uses specialised equipment that will clean the items momentarily so there is no need to remove them from the curtain rail.<br>\n <br>\n Natural/Delicate fibre<br>\n In case your curtains or drapes are too delicate, then we can offer you a variety of water-free drapery cleaning options, such as the use of dry powder or special solvents.</p>\n<p>\n  </p>\n<p>\n  </p>', 'hgfh', 'bvcx', 'vcbcxb', 'active', '2017-03-07 19:01:31', '2017-03-21 16:44:27', '2', '[{\"professionals\":\"small item\",\"unit\":\"1\",\"hours\":\"2\",\"price\":\"20\"},{\"professionals\":\"medium item\",\"unit\":\"1\",\"hours\":\"2\",\"price\":\"10\"},{\"professionals\":\"large item\",\"unit\":\"1\",\"hours\":\"2\",\"price\":\"20\"}]', '', '[{\"stuff\":\"\"},{\"stuff\":\"\"}]', '', '', '', '', '', '', '', ''),
(81, 'Free Appraisal', '01732b5da11d83e7ec45b731dca81382.jpg', 43, '<p>\r\n <span xss=\"removed\"><strong>Free Appraisal</strong></span></p>\r\n<p>\r\n <strong>Telephone</strong>: +1(800)123-4567<br>\r\n Email: info@88homepros.com<br>\r\n <br>\r\n Or fill out the contact information on this page. Provide us as much information as you are willing to give. We are very excited for the opportunity to serve you. Call Today!!!</p>\r\n<p>\r\n  </p>', 'gfgdg', 'gdgdgdg', 'fgfdgdfg', 'active', '2017-03-08 14:46:34', '2017-04-26 18:47:19', '3', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"},{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(82, 'Rental', 'ac61101fdfe6432b17abe9a2dd5ef0c3.jpg', 43, '<p>\r\n <span xss=\"removed\"><strong>Rental</strong></span></p>\r\n<p>\r\n <strong>Telephone</strong>: +1(800)123-4567<br>\r\n <br>\r\n <strong>Email</strong>: info@88homepros.com<br>\r\n <br>\r\n Or fill out the contact information on this page. Provide us as much information as you are willing to give. We are very excited for the opportunity to serve you. Call Today!!!</p>\r\n<p>\r\n  </p>', 'gfgdgdfg', 'gdfgfdg', 'gfdgfdg', 'active', '2017-03-08 14:48:21', '2017-04-26 18:49:04', '4', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"},{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(83, 'Home Inspection', '8a5fffd3ebfb1029e237f3feea966fff.jpg', 43, '<p>\r\n <span xss=\"removed\"><strong>Home Inspection</strong></span></p>\r\n<p>\r\n <strong>Telephone</strong>: +1(800)123-4567<br>\r\n <br>\r\n <strong>Email</strong>: info@88homepros.com<br>\r\n <br>\r\n Or fill out the contact information on this page. Provide us as much information as you are willing to give. We are very excited for the opportunity to serve you. Call Today!!!</p>', 'ghfghfgh', 'hgfhfhf', 'hfghfghfg', 'active', '2017-03-08 14:50:37', '2017-04-26 18:50:33', '2', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"},{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', '');
