(96, 'Drains', '0f90e7300501e6f79b36f4bec2e48f22.jpg', 84, '<p>\n <strong>Drains</strong></p>\n<p>\n <br>\n Stubborn clogged drains are no match for our expert plumbers. Don&#39;t count on an unclogging gel to fix your drainage issues.<br>\n Our fully-vetted plumbers will come prepared with the proper tools and equipment to solve your sink, shower or toilet drainage problems once and for all.</p>\n<p>\n <strong>Done by efficient, dedicated professionals</strong></p>\n<p>\n The specialists who we send out are professionally trained to work with precision and attention to detail. They will handle each task quickly and efficiently, solving your plumbing problem in the shortest amount of time possible without causing a mess at your place.</p>\n<p>\n <strong>Your satisfaction is guaranteed</strong></p>\n<p>\n The performance of every plumber is diligently monitored by supervisors. That’s how we ensure that their work is done at the highest professional level. Our ultimate goal is to bring you complete satisfaction with the services you get, thus your feedback is always welcome.</p>\n<p>\n <strong>Bringing all tools & equipment</strong></p>\n<p>\n The specialists operate with their own instruments, so we got you covered there. Plumbing repairs often require the replacement of certain parts, which is yet another thing that the specialists can take care of for you as they can readily supply everything on site (the costs will be added to your final bill).</p>', 'gfg', 'gfgfdg', 'fgdfgfd', 'active', '2017-03-20 17:58:15', '2017-04-26 17:16:14', '1', '[{\"professionals\":\"drains\",\"unit\":\"1\",\"hours\":\"1\",\"fixed_price\":\"12\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(86, 'Electrical', '7078a09343f6688ff1a28272a3190922.png', 0, '', 'fdfdsf', 'dfsfsf', 'fsdfdsf', 'active', '2017-03-20 16:03:27', '2017-05-16 18:18:22', '2', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"},{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"},{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"},{\"hourly\":\"\",\"hourly_price\":\"\"}]', '', '[{\"stuff_1\":\"\"},{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"},{\"stuff_2\":\"\"}]', '', '', ''),
(88, 'Ceiling and Bath Fans', '07cea0dfc4eee52478c37e8b6ef895ed.jpg', 86, '<p>\n <strong>Ceiling & Bath Fans</strong></p>\n<p>\n <br>\n Our professional electricians are experts installing and repairing ceiling and bathroom fans.<br>\n Every electrician is fully vetted and will arrive prepared with the proper tools and supplies to get your job done right the first time.</p>\n<p>\n  </p>\n<p>\n  <strong>Qualified electricians</strong></p>\n<p>\n The qualified electrician is able to handle all domestic electrical issues that you might be experiencing. From simple installations to meticulous rewiring and repairs, you can always count on him to get the job done. Each expert is fully insured.</p>\n<p>\n <strong>All tools & equipment provided</strong></p>\n<p>\n The electrician brings everything necessary to solve your problem, even a variety of ladders for those hard-to-get-to areas! Just make sure to let us know what you need done at least one day in advance.</p>\n<p>\n <strong>Friendly and professional</strong></p>\n<p>\n This service comes with minimal to no disturbance at all. The electrician is there to get the job done for you. He will be more than glad to answer any questions you might have while he is working on site.</p>\n<p>\n <strong>Online booking is quick & easy</strong></p>\n<p>\n Give our online booking form a try! It’s simple and it takes just a few moments. Alternatively, you can download our GoFantastic mobile app and access all our electrical services in London within just a few taps!</p>', 'ffsdff', 'fdsfsa', 'dsfas', 'active', '2017-03-20 16:46:20', '2017-04-06 18:31:55', '2', '[{\"professionals\":\"ceiling fans\",\"unit\":\"1\",\"hours\":\"10\",\"fixed_price\":\"10\"},{\"professionals\":\"bathroom fans\",\"unit\":\"1\",\"hours\":\"10\",\"fixed_price\":\"10\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', 'What do you need done?', '[{\"stuff_1\":\"New Installation\"},{\"stuff_1\":\"Repair\"},{\"stuff_1\":\"Replacement\"}]', 'Do you need us to provide a fan?', '[{\"stuff_2\":\"No\"},{\"stuff_2\":\"Yes\"}]', '', '', ''),
(84, 'Plumbing', 'a2858d815a37acfc2b326cf238ec2840.png', 0, '', 'hgfhg', 'hfghfghfgh', 'hgfhfgh', 'active', '2017-03-20 15:52:03', '2017-05-16 18:22:49', '3', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"},{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"},{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(89, 'Outlets', 'e8ebc33353c5c9d9c9b5b03a0bb5b7e6.jpg', 86, '<p>\n<strong>Outlets & Switches</strong></p>\n<p>\n  <strong>Qualified electricians</strong></p>\n<p>\n The qualified electrician is able to handle all domestic electrical issues that you might be experiencing. From simple installations to meticulous rewiring and repairs, you can always count on him to get the job done. Each expert is fully insured.</p>\n<p>\n <strong>All tools & equipment provided</strong></p>\n<p>\n The electrician brings everything necessary to solve your problem, even a variety of ladders for those hard-to-get-to areas! Just make sure to let us know what you need done at least one day in advance.</p>\n<p>\n <strong>Friendly and professional</strong></p>\n<p>\n This service comes with minimal to no disturbance at all. The electrician is there to get the job done for you. He will be more than glad to answer any questions you might have while he is working on site.</p>\n<p>\n <strong>Online booking is quick & easy</strong></p>\n<p>\n Give our online booking form a try! It’s simple and it takes just a few moments. Alternatively, you can download our GoFantastic mobile app and access all our electrical services in London within just a few taps!</p>', 'fdfdsf', 'dsfsfa', 'fsfa', 'active', '2017-03-20 16:47:58', '2017-04-06 18:40:49', '3', '[{\"professionals\":\"outlets\",\"unit\":\"1\",\"hours\":\"1\",\"fixed_price\":\"5\"},{\"professionals\":\"light switches\",\"unit\":\"1\",\"hours\":\"2\",\"fixed_price\":\"10\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', 'Do you need us to provide the outlets / switches?', '[{\"stuff_1\":\"No\"},{\"stuff_1\":\"Yes\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(90, 'Other Electrical Service', '99aad7bae0d693504de7fa1e2c87a4f9.jpg', 86, '<p>\n<strong>Electrical Service</strong></p>\n<p>\n <br>\n Our professional electricians are experts at troubleshooting all sorts of electrical issues.<br>\n Whether you need your outlet replaced, a new light fixture installed or just some light bulbs changed,<br>\n we have you covered. Every electrician is fully vetted and will arrive prepared with the proper tools and supplies to get your job done right the first time.</p>\n<p>\n <strong>Qualified electricians</strong></p>\n<p>\n The qualified electrician is able to handle all domestic electrical issues that you might be experiencing. From simple installations to meticulous rewiring and repairs, you can always count on him to get the job done. Each expert is fully insured.</p>\n<p>\n <strong>All tools & equipment provided</strong></p>\n<p>\n The electrician brings everything necessary to solve your problem, even a variety of ladders for those hard-to-get-to areas! Just make sure to let us know what you need done at least one day in advance.</p>\n<p>\n <strong>Friendly and professional</strong></p>\n<p>\n This service comes with minimal to no disturbance at all. The electrician is there to get the job done for you. He will be more than glad to answer any questions you might have while he is working on site.</p>', 'fdsgf', 'gdfs', 'gfdsgd', 'active', '2017-03-20 16:49:08', '2017-05-16 13:20:46', '4', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"price\":\"\"}]', '-', '', '[{\"hourly\":\"2\",\"hourly_price\":\"5\"},{\"hourly\":\"3\",\"hourly_price\":\"6\"},{\"hourly\":\"4\",\"hourly_price\":\"7\"},{\"hourly\":\"5\",\"hourly_price\":\"8\"},{\"hourly\":\"6\",\"hourly_price\":\"9\"},{\"hourly\":\"7\",\"hourly_price\":\"5\"},{\"hourly\":\"8\",\"hourly_price\":\"5\"},{\"hourly\":\"9\",\"hourly_price\":\"5\"},{\"hourly\":\"10\",\"hourly_price\":\"5\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(98, 'Other Plumbing', '6ccfa70586faf47c693168cd66470898.jpg', 84, '<p>\r\n <strong>Plumbing Service</strong></p>\r\n<p>\r\n <br>\r\n Our professional plumbers are experts at troubleshooting all sorts of plumbing issues.<br>\r\n Whether you need your toilet replaced, a new faucet installed or drain unclogged,<br>\r\n we have you covered. Every plumber is fully vetted and will arrive prepared with the proper tools and supplies to get your job done right the first time.</p>\r\n<p>\r\n <strong>Other Type of  Plumbing Service</strong></p>\r\n<p>\r\n ·         Sinks and basins fitting and replacement</p>\r\n<p>\r\n ·         Washing machine and dishwasher installation</p>\r\n<p>\r\n ·         Insinkerator or saniflo repair and replacement</p>\r\n<p>\r\n ·         Waste disposal installation, removal, replacement, and repair</p>', 'fsdfs', 'fsdf', 'fsdfsdf', 'active', '2017-03-20 18:01:19', '2017-06-28 13:05:09', '3', '[{\"professionals\":\"\",\"unit\":\"\",\"hours\":\"\",\"fixed_price\":\"1\"}]', '-', '', '[{\"hourly\":\"2\",\"hourly_price\":\"10\"},{\"hourly\":\"2.5\",\"hourly_price\":\"20\"},{\"hourly\":\"3\",\"hourly_price\":\"25\"},{\"hourly\":\"3.5\",\"hourly_price\":\"30\"},{\"hourly\":\"4\",\"hourly_price\":\"35\"},{\"hourly\":\"4.5\",\"hourly_price\":\"40\"},{\"hourly\":\"5\",\"hourly_price\":\"45\"},{\"hourly\":\"5.5\",\"hourly_price\":\"50\"},{\"hourly\":\"6\",\"hourly_price\":\"55\"},{\"hourly\":\"6.5\",\"hourly_price\":\"60\"},{\"hourly\":\"7\",\"hourly_price\":\"65\"},{\"hourly\":\"7.5\",\"hourly_price\":\"70\"},{\"hourly\":\"8\",\"hourly_price\":\"75\"},{\"hourly\":\"8.5\",\"hourly_price\":\"80\"},{\"hourly\":\"9\",\"hourly_price\":\"85\"},{\"hourly\":\"9.5\",\"hourly_price\":\"90\"},{\"hourly\":\"10\",\"hourly_price\":\"100\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(99, 'Toilet', '45f1d04d7cfb30862e02b6e9287b37de.jpg', 84, '<p>\n<strong>Toilets</strong></p>\n<p>\n Our professional plumbers are experts at troubleshooting all sorts of toilet issues. Whether you need flush repair or a new toilet installed completely, we have you covered. Every plumber is fully vetted and will arrive prepared with the proper tools and supplies to get your job done right the first time.</p>\n<p>\n <strong>Done by efficient, dedicated professionals</strong></p>\n<p>\n The specialists who we send out are professionally trained to work with precision and attention to detail. They will handle each task quickly and efficiently, solving your plumbing problem in the shortest amount of time possible without causing a mess at your place.</p>\n<p>\n <strong>Your satisfaction is guaranteed</strong></p>\n<p>\n The performance of every plumber is diligently monitored by supervisors. That’s how we ensure that their work is done at the highest professional level. Our ultimate goal is to bring you complete satisfaction with the services you get, thus your feedback is always welcome.</p>\n<p>\n <strong>Bringing all tools & equipment</strong></p>\n<p>\n The specialists operate with their own instruments, so we got you covered there. Plumbing repairs often require the replacement of certain parts, which is yet another thing that the specialists can take care of for you as they can readily supply everything on site (the costs will be added to your final bill).</p>\n<p>\n <strong>You only pay for what you get</strong></p>\n<p>\n As our payment system is hourly-based, you only pay for the actual time it took for the specialist to fix your plumbing problem. There’s a minimum call-out charge for the initial hour after that you are charged on half hour basis.</p>\n<p>\n <strong>Health and safety come first</strong></p>\n<p>\n We’ve got a strict Safety Policy that serves to protect both the professional and the customer. All technicians are fully insured.</p>\n<p>\n  </p>', 'fdsfdsf', 'sdfsdf', 'fdsdf', 'active', '2017-03-20 18:02:44', '2017-04-26 17:17:05', '4', '[{\"professionals\":\"flush repairs\",\"unit\":\"1\",\"hours\":\"1\",\"fixed_price\":\"5\"},{\"professionals\":\"unclog toilets\",\"unit\":\"1\",\"hours\":\"2\",\"fixed_price\":\"8\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', '', '[{\"stuff_1\":\"\"}]', '', '[{\"stuff_2\":\"\"}]', '', '', ''),
(100, 'Garbage Disposal', 'dbb7e854aa782650cc77a6099443b41d.jpg', 84, '<p>\r\n <strong>Garbage Disposal</strong></p>\r\n<p>\r\n Our professional plumbers are experts installing and repairing garbage disposals. Every plumber is fully vetted and will arrive prepared with the proper tools and supplies to get your job done right the first time.</p>\r\n<p>\r\n The specialists who we send out are professionally trained to work with precision and attention to detail. They will handle each task quickly and efficiently, solving your plumbing problem in the shortest amount of time possible without causing a mess at your place.</p>\r\n<p>\r\n <strong>Your satisfaction is guaranteed</strong></p>\r\n<p>\r\n The performance of every plumber is diligently monitored by supervisors. That’s how we ensure that their work is done at the highest professional level. Our ultimate goal is to bring you complete satisfaction with the services you get, thus your feedback is always welcome.</p>\r\n<p>\r\n <strong>Bringing all tools & equipment</strong></p>\r\n<p>\r\n The specialists operate with their own instruments, so we got you covered there. Plumbing repairs often require the replacement of certain parts, which is yet another thing that the specialists can take care of for you as they can readily supply everything on site (the costs will be added to your final bill).</p>\r\n<p>\r\n <strong>You only pay for what you get</strong></p>\r\n<p>\r\n As our payment system is hourly-based, you only pay for the actual time it took for the specialist to fix your plumbing problem. There’s a minimum call-out charge for the initial hour after that you are charged on half hour basis.</p>\r\n<p>\r\n <strong>Health and safety come first</strong></p>\r\n<p>\r\n We’ve got a strict Safety Policy that serves to protect both the professional and the customer. All technicians are fully insured.</p>\r\n<p>\r\n  </p>', 'fdsfs', 'fsdfsdf', 'sdfsdf', 'active', '2017-03-20 18:04:03', '2017-06-28 13:04:43', '5', '[{\"professionals\":\"disposals\",\"unit\":\"1\",\"hours\":\"1\",\"fixed_price\":\"2\"}]', '-', '', '[{\"hourly\":\"\",\"hourly_price\":\"\"}]', 'What do you need done?', '[{\"stuff_1\":\"New Installation\"},{\"stuff_1\":\"Repair\"},{\"stuff_1\":\"Replacement\"}]', 'Do you need us to provide a new garbage disposal?', '[{\"stuff_2\":\"\"}]', '', '', '');
